import React from 'react';


const Logout = () => {
    return(
        <form class="d-flex">
                  <label className="topBarText espaciador">Usuario: </label>
                  <button className="form-control btn btn-warning" type="submit">Login</button>
        </form>
    );
};

export default Logout;
